import React from 'react';
import { useNavigate } from 'react-router-dom';

const MyRegistrations = () => {
  const navigate = useNavigate();
  
  const registrations = [
    { id: 1, event: 'üé§ Music Festival 2024', date: '2024-12-15', status: 'Confirmed' },
    { id: 2, event: 'üíª Tech Conference', date: '2024-11-20', status: 'Pending' }
  ];

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>My Registrations</h1>
      {registrations.length === 0 ? (
        <div style={styles.empty}>
          <h3>No registrations yet</h3>
          <p>Browse events and register to see them here!</p>
        </div>
      ) : (
        <div style={styles.registrations}>
          {registrations.map(reg => (
            <div key={reg.id} style={styles.registrationCard}>
              <h3>{reg.event}</h3>
              <p><strong>Date:</strong> {reg.date}</p>
              <p><strong>Status:</strong> <span style={reg.status === 'Confirmed' ? styles.confirmed : styles.pending}>{reg.status}</span></p>
            </div>
          ))}
        </div>
      )}
      <button style={styles.backBtn} onClick={() => navigate('/')}>
        ‚Üê Back to Home
      </button>
    </div>
  );
};

const styles = {
  container: { maxWidth: '1200px', margin: '0 auto', padding: '40px 20px', minHeight: '80vh' },
  title: { textAlign: 'center', color: 'white', fontSize: '3rem', marginBottom: '40px' },
  empty: { textAlign: 'center', color: 'white', background: 'rgba(255,255,255,0.1)', padding: '40px', borderRadius: '15px' },
  registrations: { display: 'grid', gap: '20px', marginBottom: '40px' },
  registrationCard: { background: 'rgba(255,255,255,0.95)', padding: '25px', borderRadius: '15px' },
  confirmed: { color: '#28a745', fontWeight: 'bold' },
  pending: { color: '#ffc107', fontWeight: 'bold' },
  backBtn: { background: '#6c757d', color: 'white', border: 'none', padding: '12px 24px', borderRadius: '8px', cursor: 'pointer', fontSize: '16px', margin: '0 auto', display: 'block' }
};

export default MyRegistrations;
